INSERT INTO `t_article` VALUES ('ec99d637ffb0468f9e13a68fd9332d21', '2018-03-13 08:58:22', 'SUPERADMIN', '201803131111', null, '<p style=\"text-align: justify;\"><b>需要耐心啊，太急于求成，希望直接就得到解决方法了...以至于正确方法都已经出现了，我却没有耐心看下去，所以反而又耽误了不少时间....</b></p><p style=\"text-align: justify;\"><b>项目加载100+张图片，还有一个小的MP4，所以console警告缓存不够</b></p><p style=\"text-align: justify;\"><span>org.apache.catalina.webresources.Cache.getResource</span><span>&nbsp;Unable to add the resource at [/base/1325/WA6144-150x112.jpg] to the cache because there was insufficient free space available after evicting expired cache entries - consider increasing the maximum size of the cache</span><br></p><p style=\"text-align: justify;\">The<b> background cache eviction process was unable to free [10] percent of the cache for Context [/liuda] - consider increasing the maximum size of the cache. After eviction approximately [11,145] KB of data remained in the cache<br></b></p><p style=\"text-align: justify;\"><b>反正就是缓存不够了</b></p><p style=\"text-align: justify;\">http://stackoverflow.com/questions/26893297/tomcat-8-throwing-org-apache-catalina-webresources-cache-getresource-unable-to<br></p><p style=\"text-align: justify;\">上面链接是stackoverflow上出现的和我一样的错误，第二个答案成功的解决了这个警告，就是把缓存弄大点。一开始没耐心看答案，直接把代码加进server.xml了，正确的应该是加到<span>context.xml</span></p>', null, '2', '需要耐心啊，太急于求成，希望直接就得到解决方法了...以至于正确方法都已经出现了，我却没有耐心看下去，所以反而又耽误了不少时间....项目加载100+张图片，还有一个小的MP4，所以console警告缓存不够org.apache.catalina.webresources.Cache.getResource Unable to add the resource at [/base/1325/WA6144-150x112.jpg] to the cache because there was in');

